CREATE DATABASE PTPM_FINALLY_SOF306
GO
USE PTPM_FINALLY_SOF306
GO
CREATE TABLE chuc_vu
(
    id INT IDENTITY(1,1) PRIMARY KEY,
    ma VARCHAR(255) UNIQUE,
    ten NVARCHAR(50)
);
CREATE TABLE nhan_vien
(
    id INT IDENTITY(1,1) PRIMARY KEY,
    ma VARCHAR(255) UNIQUE,
    ho_ten NVARCHAR(255),
    gioi_tinh VARCHAR(20),
    dia_chi NVARCHAR(255),
    sdt VARCHAR(20),
    mat_khau VARCHAR(100),
    chuc_vu_id int,
    trang_thai int
);
CREATE TABLE ca_si
(
    id int IDENTITY(1,1) PRIMARY KEY,
    ten_ca_si NVARCHAR(255),
    que_quan NVARCHAR(255),
    tuoi int,
    cong_ty NVARCHAR(255),
    sdt VARCHAR(20),
    gioi_tinh int
);
CREATE TABLE bai_hat
(
    id int IDENTITY(1,1) PRIMARY KEY,
    ten_bai_hat NVARCHAR(255),
    ten_tac_gia NVARCHAR(255),
    ca_si_id int,
    thoi_luong int,
    ngay_san_xuat date,
    gia money,
    phat_hanh_dia int,
    ngay_ra_mat date
);

/* sequence */
CREATE SEQUENCE NhanVienSeq
START WITH 1
INCREMENT BY 1;
GO
CREATE SEQUENCE ChucVuSeq
START WITH 1
INCREMENT BY 1;
GO

/* trigger */
CREATE TRIGGER trg_ChucVu_Insert
ON chuc_vu
AFTER INSERT
AS
BEGIN
    DECLARE @new_id INT;
    DECLARE @new_ma VARCHAR(255);

    SELECT @new_id = id
    FROM inserted;
    SELECT @new_ma = 'CV' + RIGHT('000' + CAST(NEXT VALUE FOR ChucVuSeq AS VARCHAR), 3);

    UPDATE chuc_vu
    SET ma = @new_ma
    WHERE id = @new_id;
END;
GO
CREATE TRIGGER trg_NhanVien_Insert
ON nhan_vien
AFTER INSERT
AS
BEGIN
    DECLARE @new_id INT;
    DECLARE @new_ma VARCHAR(255);

    SELECT @new_id = id
    FROM inserted;
    SELECT @new_ma = 'NV' + RIGHT('0000' + CAST(NEXT VALUE FOR NhanVienSeq AS VARCHAR), 4);

    UPDATE nhan_vien
    SET ma = @new_ma
    WHERE id = @new_id;
END;
GO

